import React from 'react';

const UserList = ({ users }) => {
  return (
    <ul className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
      {users.map(user => (
        <li key={user.id} className="border rounded-md p-4 flex items-center space-x-4 hover:bg-gray-100 transition duration-300">
          <div className="bg-blue-500 rounded-full w-12 h-12 flex items-center justify-center text-white text-xl">
            {user.name.charAt(0).toUpperCase()}
          </div>
          <span className="text-lg font-semibold">{user.name}</span>
        </li>
      ))}
    </ul>
  );
};

export default UserList;
